import React, { useState } from "react";
import Row from "../row/Row";
import request from "../../commons/requests";
import "./Home.css";
function Home() {
  const [requestURL] = useState(request);
  return (
    <div className="poster">
      {requestURL.map((value) => (
        <Row
          key={value.id}
          title={value.title}
          fetchURL={value.URL}
          isLargeRow={value?.isLargeRow}
        />
      ))}
    </div>
  );
}
export default Home;
